import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import Facebook from './Facebook';
import Dachboard from './Dachboard';

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/dachboard">
                    <Dachboard />
                </Route>
                <Route path="/">
                    <Facebook />
                </Route>
            </Switch>
        </Router>
    )
}

export default App
